import React from "react";
import "./App.css";

function App() {
  const [searchResult, setSearchResult] = React.useState("");
  const [inputText, setInputText] = React.useState("");

  React.useEffect(() => {
    const url = `https://api-football-v1.p.rapidapi.com/v2/players/search/leonel`;
    const accessToken = process.env.REACT_APP_FOOTBALL_API_KEY_NAME;

    fetch(url, {
      method: "GET",
      headers: {
        "x-rapidapi-host": "api-football-v1.p.rapidapi.com",
        "x-rapidapi-key": accessToken,
      },
    })
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
      });
  });
  return (
    <div className="App">
      <h1>Hej!</h1>
    </div>
  );
}

export default App;
